import logo from '.'
import './components/css/login.css'
import LoginPage from './components/login';
import 'bootstrap/dist/css/bootstrap.min.css'



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a>
        <img src={logo} className="App-logo" alt="logo" />
        </a>



        <LoginPage/>

      </header>

    </div>
  );
}

export default App;
